<html xmlns:f="https://typo3.org/ns/TYPO3/CMS/Fluid/ViewHelpers" data-namespace-typo3-fluid="true">
    <f:layout name="Default" />
    
    <f:section name="content">
        <div class="tx-cardealer-list tx-cardealer-newbees cardealer-slick">
            <f:for each="{cars}" as="car" key="counter">

                <f:render partial="List/Slick" arguments="{car:car,args:'{args}', settings:'{settings}', identifier:'{identifier}'}" />
    
            </f:for>
        </div>
    </f:section>

</html>
